import React from "react";
import { StyleSheet, Text, View } from "react-native";

export default function UserSquadElement(squad) {
	return (
		<View style={styles.container}>
			<Text style={styles.title}>{("Hello", squad.name)}</Text>
		</View>
	);
}

const styles = StyleSheet.create({
	container: {
		paddingTop: "5%",
		justifyContent: "center",
		backgroundColor: "red",
	},
	title: {
		width: "90%",
		fontSize: 35,
		fontWeight: "500",
	},
});
